import React from "react";
import "./Home";
import Navbar from "../../components/navbar/Navbar";
import MenuHeader from "../../components/menuHeader/MenuHeader";
const Home = () => {
  return (
    <>
      <Navbar />
      <MenuHeader/>
      <div>Home</div>
    </>
  );
};

export default Home;
